import React, { useState } from 'react';
import { Container, Card, Button } from 'react-bootstrap';

// ApplicantProfile component to display the profile of a job applicant
const ApplicantProfile = ({ applicant, onAccept, onReject }) => {
  return (
    <div className="mt-3">
      <h4>Profil Pelamar:</h4>
      <p>Nama: {applicant.name}</p>
      <p>Email: {applicant.email}</p>
      <p>Keahlian: {applicant.skills.join(', ')}</p>
      <p>Pengalaman: {applicant.experience}</p>
      <p>Pendidikan: {applicant.education}</p>
      <p>Portofolio: <a href={applicant.portfolio} target="_blank" rel="noopener noreferrer">{applicant.portfolio}</a></p>
      <p>LinkedIn: <a href={applicant.linkedin} target="_blank" rel="noopener noreferrer">LinkedIn</a></p>
      <Button variant="success" className="ml-2" onClick={onAccept}>
        Terima
      </Button>
      <Button variant="danger" className="ml-2" onClick={onReject}>
        Tolak
      </Button>
    </div>
  );
};

const JobDetailPage = () => {
  const jobListings = [
    // ... (same as before)
  ];

  const [selectedJob, setSelectedJob] = useState(null);
  const [selectedApplicant, setSelectedApplicant] = useState(null);
  const [applicants, setApplicants] = useState([]);

  const handleJobClick = (jobId) => {
    // ... (same as before)
  };

  const handleViewProfile = (applicantId) => {
    // ... (same as before)
  };

  const handleAccept = (applicantId) => {
    // ... (same as before)
  };

  const handleReject = (applicantId) => {
    // ... (same as before)
  };

  return (
    <Container>
      <h1 className="mt-4">Pekerjaan</h1>
      <div className="my-4">
        {jobListings.map((job) => (
          <Card key={job.id} className="mb-3">
            <Card.Body>
              <h2>{job.position}</h2>
              <h3>{job.company}</h3>
              <Button onClick={() => handleJobClick(job.id)}>Lihat Detail</Button>
              {selectedJob === job.id && (
                <div className="mt-3">
                  <h4>Deskripsi Pekerjaan:</h4>
                  <p>{job.description}</p>

                  <h4>Persyaratan:</h4>
                  <ul>
                    {job.requirements.map((requirement, index) => (
                      <li key={index}>{requirement}</li>
                    ))}
                  </ul>

                  <h4>Manfaat:</h4>
                  <ul>
                    {job.benefits.map((benefit, index) => (
                      <li key={index}>{benefit}</li>
                    ))}
                  </ul>

                  <h4>Pelamar Pekerjaan:</h4>
                  <ul>
                    {applicants.map((applicant) => (
                      <li key={applicant.id}>
                        {applicant.name} - {applicant.email}
                        <Button
                          variant="primary"
                          className="ml-2"
                          onClick={() => handleViewProfile(applicant.id)}
                        >
                          Lihat Profil
                        </Button>
                        {selectedApplicant === applicant && (
                          <ApplicantProfile
                            applicant={applicant}
                            onAccept={() => handleAccept(applicant.id)}
                            onReject={() => handleReject(applicant.id)}
                          />
                        )}
                      </li>
                    ))}
                  </ul>
                </div>
              )}
            </Card.Body>
          </Card>
        ))}
      </div>
    </Container>
  );
};

export default JobDetailPage;
